import { Box } from "@mui/material";
import { DataGrid, GridToolbar } from "@mui/x-data-grid";
import { tokens } from "../../theme";
import { mockDataContacts } from "../../data/mockData";
import Header from "../../components/Header";
import { useTheme } from "@mui/material";


const TrippingBreakdown = () => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);

  const columns = [
    { field: "circle", headerName: "Circle", flex: 0.5 },
    { field: "TotalTrippingcount", headerName: "Total Tripping count" },
    // {
    //   field: "TotalOutageinhrsduetoTripping",
    //   headerName: "Total Outage in hrs due to Tripping",
    //   flex: 1,
    //   cellClassName: "name-column--cell",
    // },
    // {
    //   field: "TotalBreakdownCount",
    //   headerName: "Total Breakdown Count",
    //   type: "number",
    //   headerAlign: "left",
    //   align: "left",
    // },
    // {
    //   field: "TotalOutageinHrsDuetoBreakdown",
    //   headerName: "Total Outage in Hrs Due to Breakdown",
    //   flex: 1,
    // },
    // {
    //   field: "TotalCount",
    //   headerName: "Total Count",
    //   flex: 1,
    // },
    // {
    //   field: "TotalHrs",
    //   headerName: "Total Hrs",
    //   flex: 1,
    // },
  ];

  return (
    <Box m="20px">
      <Header
        title="CONTACTS"
        subtitle="List of Contacts for Future Reference"
      />
      <Box
        m="40px 0 0 0"
        height="75vh"
        sx={{
          "& .MuiDataGrid-root": {
            border: "none",
          },
          "& .MuiDataGrid-cell": {
            borderBottom: "none",
          },
          "& .name-column--cell": {
            color: colors.greenAccent[300],
          },
          "& .MuiDataGrid-columnHeaders": {
            backgroundColor: colors.blueAccent[700],
            borderBottom: "none",
          },
          "& .MuiDataGrid-virtualScroller": {
            backgroundColor: colors.primary[400],
          },
          "& .MuiDataGrid-footerContainer": {
            borderTop: "none",
            backgroundColor: colors.blueAccent[700],
          },
          "& .MuiCheckbox-root": {
            color: `${colors.greenAccent[200]} !important`,
          },
          "& .MuiDataGrid-toolbarContainer .MuiButton-text": {
            color: `${colors.grey[100]} !important`,
          },
        }}
      >
        <DataGrid
          rows={mockDataContacts}
          columns={columns}
          components={{ Toolbar: GridToolbar }}
        />
      </Box>
    </Box>
  );
};

export default TrippingBreakdown;
